	[character]
	_addr="0xad7ed48"
	current_frame="normal"
	custom="yes"
	face_right="yes"
	label="Manager"
	on_talk="[speech_dialog(
						self,				[~Hello there. I am Jove.~],
						
						level.player,		set(level.player.animation, 'emote_talk'),
											[~Hi. I'm Frogatto.\nWhat do you do here?~],
											
						self,				[~I am the manager of this mining\ncamp, and the proprietor of\nthe only restaurant in town.\nI hope you'll understand if all\nwe have to offer is outdoor\nseating, things are a bit cramped\nin back.~],
											
						level.player,		[~1: Tell me about the mines.\n2: Tell me about the restaurant.~,
												~Opt. 1~, [
													speech_dialog(
														self,				[~What would you like to know?~],
														
														level.player,		[~1: How are labour relations?\n2: How do you mine wood?~,
															~Opt. 1~, [
																speech_dialog(
																	self,				[~Things are surprisingly good,\nactually. We're a pretty small\noutfit, so complaints get dealt\nwith quickly. That, and I think\nwe're all a little scared for\nour jobs right now. With the\nfungus infestation, people aren't buying\nas much art-wood as they\nused to. I'll be honest, we\nsell all sorts of stuff,\nbut the fine old-growth was\nour cash cow. Right now, people\nare buying cheap wood, planks,\nshavings, stuff like that. They're\nmoving away from this fungus\nstuff. Building new houses, putting\nstuff in storage, etc. I mean, you\nnoticed there weren't very\nmany people around of late.\nStill, I don't think we'll\ngo broke or anything. We\nare still selling plenty of the\nlower-grade timber. Still, it\nis a bit worrying.~],
																						
																	level.player,		set(level.player.animation, 'emote_talk'),
																						[~In other words, Jove, the\nworkers don't want to be\nannoying right before potential\nlayoffs?~],
																						
																	self,				[~Dead on.\nBy the way, how is the town\nholding out?~],
																						
																	level.player,		set(level.player.animation, 'emote_talk'),
																						[~Most of them are staying,\nfor now. It's not too bad.~],
																						
																	self,				[~Good. Where there's life,\nthere's hope.~],
																	)
																],
															~Opt. 2~, [
																speech_dialog(
																	self,				[~We use the normal stuff.\nAxes, saws, brooms, teleporters.~],
																						
																	level.player,		set(level.player.animation, 'emote_talk'),
																						[~Trade secret?~],
																						
																	self,				[~Yep.~],
																	
																	level.player,		set(level.player.animation, 'emote_raisedfinger'),
																						[~I guess you'd mind me looking\naround then, wouldn't you.~],
																						
																	self,				[~No, not at all. Go wherever\nyou like. It's a TRADE\n	secret, everyone who mines wood\nknows it, and everyone who doesn't\nisn't a threat to us, business-wise!~],
																						
																	level.player,		set(level.player.animation, 'emote_confused'),
																						[~Oh.~],
																	)
																],
															~Cancel~, [
																speech_dialog(
																	level.player,		set(level.player.animation, 'emote_talk'),
																						[~... It's gone. Sorry.~],
																	self,				[~See you.~],
																	)
																],
															],
														),
													],
												~Opt. 2~, [
													speech_dialog(
														self,				[~We serve rough, good food-\nand lots of it! It's not\none of those restaurants for sissies!\nAnyway, what can I get for you?~],
																			
														level.player,		[~1: Food Menu\n2: <*Guess restaurant name.*>~,
															~Opt. 1~, [
																speech_dialog(
																	level.player,		set(level.player.animation, 'emote_confused'),
																						[~I'll have the...~,
																		~Slow Moe~, [
																			speech_dialog(
																				self,				[~One Slow Moe, coming right up.\n\n\n\n\nWhat?~,],
																				),
																			spawn('powerup_reflexes',2300,-2700,1),
																			],
																		~Shooter~, [
																			speech_dialog(
																				self,				[~Shooter. Never know how they\nmake these things. *shakes head*~],
																				),
																			spawn('powerup_shooting',2300,-2700,1),
																			],
																		~Turtle~, [
																			speech_dialog(
																				self,				[~I once tried to make a soup out\nof this stuff. I had to throw\nout the pot.~],
																				),
																			spawn('powerup_invincible',2300,-2700,1),
																			],
																		~Heart~, [
																			speech_dialog(
																				self,				[~Would you like the heart without\nany traceable mercury, or the\nheart without any detectable\nlead? Nah, just kidding, I\nserve only the finest*.\n\n*That exists in this restaurant.~],
																				level.player,		[~Oh, just pass the buckshot,\nwould you?~],
																				),
																			spawn('heart_object',2300,-2700,1),
																			],
																		~Fruit~, [
																			speech_dialog(
																				self,				[~It's foreign, but it ships well.~],
																				),
																			spawn('heart_fruit',2300,-2700,1),
																			],
																		~Special~, [
																			speech_dialog(
																				self,				[~The special today is the\npartial maximum heart. This is\na delicacy, though, so unlike most\nof the stuff here it'll run\nyou 35 coins. Would you still\nlike to buy it?~, #changed $35 to 35 coins, as per Chopple, it's the name of the currency#
																					~Yes~, [
																						speech_dialog(
																							self,				[~Great! You wouldn't believe the\ntrouble I've had selling this!~],
																							),
																							#set(level.player.vars.coins, level.player.vars.coins - 35),#
																							spawn('partial_max_heart_object',2300,-2700,1),
																						],
																					~No~, [
																						speech_dialog(
																							self,				[~Probably the best choice, given how\nlong it's been sitting around.~],
																							),
																						],
																					],
																				),
																			],
																		~Nothing~, [
																			speech_dialog(
																				level.player,				[~Sorry Jove, maybe later.~],
																				),
																			],
																		]
																	)
																],
															~Opt. 2~, [
																speech_dialog(
																	level.player,		set(level.player.animation, 'emote_talk'),
																						[~Is your restaurant called\n'That's good food, by J--~],
																						
																	self,				[~I bet I can throw you off the\nedge of this town from here.\nIf you want to find out,\nkeep talking.~],
																						
																	level.player,		set(level.player.animation, 'emote_geez'),
																						[~Yeesh, I was just asking.~],
																						
																	self,				[~You wouldn't believe how much\nI get that.~],		#one of these days, he is going to start counting down from 1.#
																	)
																],
															~More~, [
																speech_dialog(
																	level.player,		[~3: Odd table you have there.~,
																		~Opt. 3~, [
																			speech_dialog(
																				self,				[~Yeah, I took the legs off\nand screwed it to the deck.\nThat model is oddly tall,\ndon't you think? It's like\none-size-fits-none. I mean,\nI could WALK under it!~],
																									
																				level.player,		set(level.player.animation, 'emote_talk'),
																									[~I should do the same. I've\ngot the same model at home.~],
																				)
																			],
																		~Cancel~, [
																			speech_dialog(
																				level.player,		set(level.player.animation, 'emote_raisedfinger'),
																									[~Sorry, I'm kind of full.~],
																									
																				self,				[~Happens to the best of us.\nI remember I was full, once.~],
																				)
																			],
																		]
																	)
																],
															],
														),
													],
												~Cancel~, [
													speech_dialog(
														level.player,		[~That's nice.~],
														),
													],
												]
						)
					]"
	time_in_frame="0"
	type="gritus_npc"
